import React, { Component } from 'react'

export default class Login extends Component {
  constructor() {
    this.state = {
      loginComplete: false,
    }
  }


  handleClick = () => {
    this.setState({
      loginComplete: true,
    });

  };

  render() {
    return (
      <div>
        <input type="email" />
        <input type="password" />
        <button type="button" onClick={ this.handleClick }>Login</button>
      </div>
    )
  }
}
